import axios from 'axios';
import kakaoAuthKey from 'global/authKey';
import queryString from 'querystring';

export const SearchKeyword = async (keyword) => {
    await axios.get('https://dapi.kakao.com/v2/local/search/keyword.json', {
        headers: {
            'Authorization': `KakaoAK ${kakaoAuthKey}`,
            'content-type': 'application/x-www-form-urlencoded'
        },
        params: { query: `${queryString.stringify(keyword)}`}
    }).then((res)=> {
        console.log(res.data.documents);
    }).catch((error) => {
        console.log(error);
    });
};

// export SearchKeyword;
